import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import { Card, CardActionArea, CardContent, CardMedia, Typography } from '@material-ui/core';
import { restaurantService } from '../../services/restaurant.service';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
}));


export function ListRestaurant(props) {
    const classes = useStyles();
    const userId = JSON.parse(localStorage.getItem('user')).data.user._id;
    const [data, setData] = useState();
    useEffect(() => {
        restaurantService.getRestaurantByUser(userId)
            .then((res) => {console.log(res.data.data.restaurant);setData(res.data.data.restaurant)})
            .catch(err => console.log(err));
    }, [])
    return (
        <List>
            {data ?
                data.map(ele => {
                    <ListItem>
                        <Card>
                            <CardActionArea>
                                <CardContent>
                                    <Typography gutterBottom variant="h5" component="h2">
                                    {
                                        ele.restaurantname
                                    }
                            </Typography>
                                    <Typography variant="body2" color="textSecondary" component="p">
                                        Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                                        across all continents except Antarctica
                            </Typography>
                                </CardContent>
                            </CardActionArea>
                        </Card>
                    </ListItem>
                })

                : "ABC"
            }
        </List>
    );
}
